  "geo" : { },
  "id_str" : "1063285627372765185",
  "text" : "This is that last time I'm going to speak about this. The entire thing was blown out of proportion. I have a family member who's gay, I know what a homophobe is. I've dealt with those kinds of people. iKON members are not homophobes. https:\/\/t.co\/JIXqqSMh8Z",
