  "in_reply_to_status_id_str" : "1063285627372765185",
  "geo" : { },
  "id_str" : "1063285628580679681",
  "in_reply_to_user_id" : 3119862113,
  "text" : "For all the 4+ yrs I've followed these kids, not once did they ever make me feel discriminated against based on my race, looks or sexuality. The group have always encouraged their fans to be true to who they are, to prioritize their own well-beings, &amp; to care for those around us.",
